import React from 'react';
import styles from './navbar.module.css';
import { Link } from 'react-scroll';

const navlinks = [
    {
        name: 'Contact',
        link: 'mycontact'
    },
    {
        name: 'Projects',
        link: 'myprojects'
    },
    {
        name: 'Skills',
        link: 'myskills'
    },
    {
        name: 'Services',
        link: 'myservices'
    },
    {
        name: 'About',
        link: 'herosection'
    },
    {
        name: 'Home',
        link: ''
    },
]

const Links = () => {

    return (

        navlinks.map((navlink, index) =>
            <Link 
            key={index} 
            activeClass="active" 
            to={navlink.link}
            spy={true} 
            smooth={true} 
            offset={-190} 
            duration={500}
            >
            {navlink.name}
            </Link>
        )
    )
}

const Navbar = () => {

    const navIconClick = () => {
        const element = document.getElementById('navbar');
        if (element.className === 'navbar'){
            element.className = 'navbar_collapse'; 
        }
        else if (element.className === 'navbar_collapse'){
            element.className = 'navbar';
        }
        else{
            element.className = 'navbar';
        }
    }

    return (
        <div className={styles.navbar} id='navbar'>
            <p>MyFolio</p>
            <Links/>
            <i className="fa-solid fa-bars" onClick={navIconClick}></i>
        </div>
    );
}

export default Navbar;
